/*Table structure for table `manager` */

DROP TABLE IF EXISTS `manager`;

CREATE TABLE `manager` (
  `mid` int(5) NOT NULL,
  `mname` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL,
  `password` varchar(128) COLLATE utf8_unicode_ci DEFAULT NULL,
  `mcollege` int(5) DEFAULT NULL,
  `mage` int(3) DEFAULT NULL,
  `msex` char(8) COLLATE utf8_unicode_ci DEFAULT NULL,
  `maddress` varchar(300) COLLATE utf8_unicode_ci DEFAULT NULL,
  `mphone` varchar(11) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`mid`),
  KEY `ma1` (`mcollege`),
  CONSTRAINT `ma1` FOREIGN KEY (`mcollege`) REFERENCES `college` (`cid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

